    try {
      //const response = await GOODS;
      console.log('fetching');

      const response = fetch('goods.json')
        .then((res) => res.json())
        .then((data) => {
          //console.log(data);
        });
      //console.log(response);

      console.log(response);
    } catch (e) {}
  };
};
